import React, { useEffect, useState } from 'react';
const { default: axios } = require('axios');

// A card used to contain all data from api
export default function CardWeather(){

    var data;
    var icons;

    useEffect(() => {

        (async function fetch(){
            await axios.get('http://localhost:9000/weather?day=3').then(all => data = all.data);
            await axios.get('http://localhost:9000/weather/icon?day=3').then(all => icons = all.data);
            console.log(icons[0]);
        })();
        
    }, []);

    return(
        <section className='container'>
            <div className='today'>
                <h1 className='title'>Today</h1>
                <img src={icons[0]} className='icon'/>
            </div>
        </section>
    );    
}

